import React from 'react';
import './About.css';

function About() {
  return (
    <div className='About'>
     <span>
      <button selected='selected'>About Bernard</button>
      <button>Experience</button>
      <button>Freelance Reporting</button>
      <button>Coding</button>
      <button>Contact</button>
     </span>
    </div>
  );
}

export default About;
